Information
------------------------------

Professor Hutton's Curiosities
Britain has a rich history of museums, but there are many full of history and curious objects that are not so well so known. Most of these 'secret' Museums are housed in small buildings, tucked away from the mainstream in hidden corners of our cities. The brand new and exclusive 12-part series takes viewers on a journey with enthusiastic academic and historian, Professor Ronald Hutton, to the unsung gems of British museums. Each episode features a different museum that is bursting with little known history. Professor Hutton visits little known places all over the country, including the Magic Circle museum; the Grant museum of Zoology, which houses a fascinating and macabre Victorian skeletons and remains in jars; Pollock's Toy museum; and Egyptian mummies inside the Petrie Museum.



2)  Grant Museum 
In the second episode, Professor Hutton visits The Grant Museum and The Magic Circle Museum. The Grant Museum is the only remaining university zoological museum in London. It houses around 67,000 animal specimens, and is packed with all manner of skeletons and stuffed creatures from all corners of the earth. The Magic Circle museum is housed within the Magic Circle Headquarters, tucked away in a back street next to Euston Station. It has a wonderful collection of props and tricks dating back to Victorian times.



